import React from 'react'
import ReactDOM from 'react-dom/client'
import {
    createBrowserRouter,
    RouterProvider,
    Route,
  } from "react-router-dom";

import './index.css'

import Invoice from './Invoice'

// ========================================
  
const root = ReactDOM.createRoot(document.getElementById("root"))
root.render(
    <React.StrictMode>
        <RouterProvider />
        <Invoice />
    </React.StrictMode>
)
